column20538:
Here is an example of how you can use the Azure Cosmos DB Java SDK to process the change feed of a NoSQL database:

import com.azure.cosmos.CosmosAsyncClient;
import com.azure.cosmos.models.CosmosItemProperties;
import com.azure.cosmos.models.CosmosQueryRequestOptions;
import com.azure.cosmos.util.CosmosPagedIterable;
import reactor.core.publisher.Flux;

public class ChangeFeedExample {
    private static final String DATABASE_NAME = "databaseName";
    private static final String CONTAINER_NAME = "containerName";

    public static void main(String[] args) {
        CosmosAsyncClient client = CosmosAsyncClient.create("YOUR_AZURE_COSMOS_ACCOUNT_URI",
                "YOUR_AZURE_COSMOS_ACCOUNT_KEY");

        // Create a query request options object
        CosmosQueryRequestOptions options = new CosmosQueryRequestOptions();
        options.setPartitionKey("/partitionKey");

        // Get a change feed of all items in the container
        Flux<CosmosItemProperties> changeFeed = client.getDatabase(DATABASE_NAME)
                .getContainer(CONTAINER_NAME)
                .queryItems("SELECT * from c", options, CosmosItemProperties.class)
                .byPage()
                .flatMap(CosmosPagedIterable::getElements);

        // Process each change in the change feed
        changeFeed.subscribe(change -> {
            // Your code to process each change
        });
    }
}

